svg.script:
document.onmousemove = makeZoom;
window.onload = function() {
	svgDoc = document.firstChild;
	var rangeText = svgDoc.getAttribute("viewBox");
	viewBox = rangeText.split(" ");
}


function changeViewBox(coord, scale) {
	var width = svgDoc.clientWidth;
	var height = svgDoc.clientHeight;
	for (var i=0; i<viewBox.length; i++) {
		viewBox[i] = parseFloat(viewBox[i]);
	}
	var clipX = viewBox[0] + (1 - 1/scale) * viewBox[2] * (coord[0] / width);
	var clipY = viewBox[1] + (1 - 1/scale) * viewBox[3] * (coord[1] / height);
	var clipW = viewBox[2]/scale;
	var clipH = viewBox[3]/scale;

	var newViewBox =
		parseInt(clipX) + " " +
		parseInt(clipY) + " " +
		parseInt(clipW) + " " +
		parseInt(clipH);

	svgDoc.setAttribute("viewBox", newViewBox);
}

function fixXY(coord) {
	var range = viewBox;
	var width = svgDoc.clientWidth;
	var height = svgDoc.clientHeight;

	for (var i=0; i<range.length; i++) {
		range[i] = parseFloat(range[i]);
	}
	
	var x = range[0] + range[2] * coord[0] / width;
	var y = range[1] + range[3] * coord[1] / height;

	var result = [];
	result.push(parseInt(x));
	result.push(parseInt(y));

	return result;
}

function makeZoom(e) {
	var svgns = "http://www.w3.org/2000/svg";
	var coordinate = getCursorXY(e);
	changeViewBox(coordinate, 2);
	var svgCoordinate = fixXY(coordinate);
	
	var zoom_circle = document.getElementsByClassName("zoom_circle");
	for (var i = 0 ; i < zoom_circle.length ; i++) {
		zoom_circle[i].setAttributeNS(null, 'cx', svgCoordinate[0]);
		zoom_circle[i].setAttributeNS(null, 'cy', svgCoordinate[1]);
	}
}

function getCursorXY(e) {
	var x = (window.Event) ? e.pageX : event.clientX + (document.documentElement.scrollLeft ? document.documentElement.scrollLeft : document.body.scrollLeft);

	var y = (window.Event) ? e.pageY : event.clientY + (document.documentElement.scrollTop ? document.documentElement.scrollTop : document.body.scrollTop);

	document.getElementById('cursorX').firstChild.nodeValue = x;
	document.getElementById('cursorY').firstChild.nodeValue = y;

	var result = [];
	result.push(x);
	result.push(y);
	return result;
}
